  // Array of client data//
  const Testimonial = () => {
  const clients = [
    {
      img: profilepic1,
      review:
        "lorem ispum dolor sit amet consectetur adipisicing elit. Quod itaque aperiam quos eaque quasi quas exercitationem",
    },
    {
      img: profilepic2,
      review:
        "lorem ispum dolor sit amet consectetur adipisicing elit. Quod itaque aperiam quos eaque quasi quas exercitationem",
    },
    {
      img: profilepic3,
      review:
        "lorem ispum dolor sit amet consectetur adipisicing elit. Quod itaque aperiam quos eaque quasi quas exercitationem",
    },
    {
      img: profilepic4,
      review:
        "lorem ispum dolor sit amet consectetur adipisicing elit. Quod itaque aperiam quos eaque quasi quas exercitationem",
    },
  ]
  return(
    <div className="t-wrapper">
      <div className="t-heading">
        {/* Heading for the testimonials section */}
        <span>Clients always get</span>
        <span>Exceptional Work</span>
        <span>from me...</span>
        {/* Background blur elements */}
        <div
          className="blur t-blur1"
          style={{ background: "var(--purple)" }}
        ></div>
        <div className="blur t-blur2" style={{ background: "skyblue" }}></div>
      </div>
      {/* Swiper component for the testimonials */}
      <Swiper
        modules={[Pagination]}
        slidesPerView={1}
        pagination={{clickable: true}}
      >
          {clients.map((client, index)=>{
            return(
              <SwiperSlide key={index}>
                  <img src={client.img} alt="" />
                    <span>{client.review}</span>
              </SwiperSlide>
            )
          })}

      </Swiper>
    </div>
  );
     };
export default Testimonial;
